import React from 'react';
import { fetchWeatherApi } from 'openmeteo';

const ForecastGrid = () => {
  const [weatherData, setWeatherData] = useState(null);

  const range = (start, stop, step) =>
    Array.from({ length: (stop - start) / step }, (_, i) => start + i * step);

  const fetchWeatherApi = async (url, params) => {
    const response = await fetch(`${url}?${new URLSearchParams(params)}`);
    const data = await response.json();
    return data;
  };

  const WeatherComponent = () => {


    useEffect(() => {
      const params = {
        latitude: 52.52,
        longitude: 13.41,
        current: [
          'temperature_2m',
          'apparent_temperature',
          'is_day',
          'rain',
          'showers',
          'snowfall',
          'weather_code',
          'cloud_cover',
          'wind_speed_10m',
        ],
        hourly: [
          'temperature_2m',
          'apparent_temperature',
          'rain',
          'showers',
          'snowfall',
          'cloud_cover',
          'wind_speed_10m',
          'wind_direction_10m',
        ],
        daily: [
          'weather_code',
          'temperature_2m_max',
          'sunrise',
          'sunset',
          'daylight_duration',
          'sunshine_duration',
          'uv_index_max',
          'rain_sum',
          'showers_sum',
          'snowfall_sum',
          'wind_speed_10m_max',
          'wind_direction_10m_dominant',
        ],
        timezone: 'auto',
        forecast_days: 16,
      };
      const url = 'https://api.open-meteo.com/v1/forecast';

      const getData = async () => {
        const responses = await fetchWeatherApi(url, params);
        const response = responses[0];

        const utcOffsetSeconds = response.utcOffsetSeconds;
        const timezone = response.timezone;
        const timezoneAbbreviation = response.timezoneAbbreviation;
        const latitude = response.latitude;
        const longitude = response.longitude;

        const current = response.current;
        const hourly = response.hourly;
        const daily = response.daily;

        const weatherData = {
          current: {
            time: new Date((Number(current.time) + utcOffsetSeconds) * 1000),
            temperature2m: current.variables[0].value,
            apparentTemperature: current.variables[1].value,
            isDay: current.variables[2].value,
            rain: current.variables[3].value,
            showers: current.variables[4].value,
            snowfall: current.variables[5].value,
            weatherCode: current.variables[6].value,
            cloudCover: current.variables[7].value,
            windSpeed10m: current.variables[8].value,
          },
          hourly: {
            time: range(Number(hourly.time), Number(hourly.timeEnd), hourly.interval).map(
              (t) => new Date((t + utcOffsetSeconds) * 1000)
            ),
            temperature2m: hourly.variables[0].valuesArray,
            apparentTemperature: hourly.variables[1].valuesArray,
            rain: hourly.variables[2].valuesArray,
            showers: hourly.variables[3].valuesArray,
            snowfall: hourly.variables[4].valuesArray,
            cloudCover: hourly.variables[5].valuesArray,
            windSpeed10m: hourly.variables[6].valuesArray,
            windDirection10m: hourly.variables[7].valuesArray,
          },
          daily: {
            time: range(Number(daily.time), Number(daily.timeEnd), daily.interval).map(
              (t) => new Date((t + utcOffsetSeconds) * 1000)
            ),
            weatherCode: daily.variables[0].valuesArray,
            temperature2mMax: daily.variables[1].valuesArray,
            sunrise: daily.variables[2].valuesArray,
            sunset: daily.variables[3].valuesArray,
            daylightDuration: daily.variables[4].valuesArray,
            sunshineDuration: daily.variables[5].valuesArray,
            uvIndexMax: daily.variables[6].valuesArray,
            rainSum: daily.variables[7].valuesArray,
            showersSum: daily.variables[8].valuesArray,
            snowfallSum: daily.variables[9].valuesArray,
            windSpeed10mMax: daily.variables[10].valuesArray,
            windDirection10mDominant: daily.variables[11].valuesArray,
          },
        };

        setWeatherData(weatherData);
      };

      getData();
    }, []);
  }

  return (
    <div onLoad={()=>WeatherComponent()}>
      Ich bin die Faorecast Ãœbersicht der einzelnen Tage

      <div>
      {weatherData ? (
        <div>
          <h1>Current Weather</h1>
          <p>Temperature: {weatherData.current.temperature2m}</p>
          {/* Render more current weather details */}

          <h1>Hourly Weather</h1>
          {weatherData.hourly.time.map((time, index) => (
            <div key={index}>
              <p>Time: {time.toISOString()}</p>
              <p>Temperature: {weatherData.hourly.temperature2m[index]}</p>
              {/* Render more hourly weather details */}
            </div>
          ))}

          <h1>Daily Weather</h1>
          {weatherData.daily.time.map((time, index) => (
            <div key={index}>
              <p>Date: {time.toISOString()}</p>
              <p>Max Temperature: {weatherData.daily.temperature2mMax[index]}</p>
              {/* Render more daily weather details */}
            </div>
          ))}
        </div>
      ) : (
        <p>Loading weather data...</p>
      )}
    </div>
    </div>
  )
}

export default ForecastGrid;
